import React from "react";
import "./App.css";

class Button extends React.Component {
    render() {
        <div id="navs">
            <span></span>
        </div>
    }
}

class Template extends React.Component {
    render() {
        return (
            <div id="container">
                <div id="nav-bar">
                </div>
                <div id="logo"></div>
                <footer>
                    <div id="address"></div>
                </footer>
            </div>
        )
    }
}

export default Template;
